//筛选想要的input标签
function test(elemType,attribte){

    var eArray = document.getElementsByTagName(elemType);
    //var inputArray = document.getElementsByTagName(parentElem)[0].getElementsByTagName(elemType);
    if(attribte!=""){
        var array = [];
        for (let i = 0; i <eArray.length; i++){
            if(eArray[i].name==attribte){
                array.push(eArray[i]);
            }
        }
        return array;
    }else{
        return eArray;
    }

}




//选中符合条件的单选复选框
function select(inputList,values){
    var elemType = inputList[0].type;
    if(values == "\u6B63\u786E"){
        values = "A";
    }else if(values == "\u9519\u8BEF"){
        values = "B";
    }
    for(let x = 0; x<inputList.length;x++){
        if(elemType=="radio"){
            if(inputList[x].value == values){
                inputList[x].checked = true;
                //li[i].classList.add("on");

            }
        }

        if(elemType == "checkbox"){
            if( values.includes(inputList[x].value)){
                inputList[x].checked = true;
                //li[i].classList.add("on");

            }
        }
    }
}

